<p>Here's a bit of my code:</p>
<pre><code>const   express = require ('express'),
        mongoose = require (&quot;mongoose&quot;),
        Model = require(&quot;././models/model&quot;),
        bodyParser = require('body-parser'),
        app = express();

app.set(&quot;view engine&quot;, &quot;ejs&quot;);
app.use(express.static(&quot;public&quot;));
require('dotenv').config({ path: './.env'});
app.use(bodyParser.urlencoded({extended: true}));

//ROUTES
app.get('/', function(req, res){
    res.render(&quot;index&quot;)
})
app.post('/', function(req, res){
    var main= new Model({
        from: req.body.from,
        to: req.body.to,
        amount: req.body.amount,
        description: req.body.description
    })
    main.save(function(err, mainModel){
        if (err){
            res.send(err)
        }else{
            res.redirect('/')

        }
    })
})


mongoose.set('useFindAndModify', false);
mongoose.connect(process.env.DATABASE_URL, { useNewUrlParser: true, useUnifiedTopology: true });

app.listen(process.env.PORT || 8080, function(){
    console.log(&quot;APP IS RUNNING!!!&quot;)
})
</code></pre>
<p>P.S: Everything works on my laptop and the post request redirects to '/' but on the production URL, the post request is not completed and it redirects to an empty page with just {}. I'm using a live DB for process.env.DATABASEURL</p>

